import React from 'react'
import { Map, Marker, GoogleApiWrapper } from 'google-maps-react'


const mapStyles = {
  width: 'calc(100vw - 600px)',
  height: '90vh',
};

const containerStyle = {
  width: '100%',
  height: '100%',
  position: 'relative',
}

const MapInstance = props => {
  return (
    <Map
      google={props.google}
      zoom={12}
      style={mapStyles}
      containerStyle={containerStyle}
      initialCenter={{ lat: 35.2271, lng: -80.8431}}>

      {props.therapists.map(therapist =>
        { if (therapist.location) {
          console.log(therapist.location.lat)
          (<Marker position={{ lat: therapist.location.lat, lon: therapist.location.lon }}/>)
        }}
      )}
    </Map>

  )
}

export default GoogleApiWrapper({
  apiKey: process.env.GOOGLE_MAPS_API_KEY
})(MapInstance);

//To-Do Secure API Key
